package javaCollection;

import java.util.Stack;

public class TwoStack {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		Stack s1= new Stack();
		
		Stack s2=new Stack();
		
		s1.push(1);
		s1.push(2);
		s1.push(3);
		
		s2.push(4);
		s2.push(5);
		s2.push(6);
		
		System.out.println("Stack 1: "+s1);
		System.out.println("Stack 2: "+s2);

	}

}
